The determinant of the matrix is equal to the product of the entries on the main diagonal:

\begin{equation}
\det{M} = m_{11}m_{22}-m_{12}^2.
\end{equation}

 approximating the entries to two decimal places would give:

\begin{equation}
\det{M}\approx m_{11}m_{22}-0.9m_{12}^2.
\end{equation}

Since the determinant is a positive number, we can deduce that both $m_{11}$ and $m_{22}$ must be greater than or equal to 0. If one of the entries was equal to 0, then the determinant would also be zero, which is not possible.
